import { useEffect, useState } from "react"
import { URL_ESTRUTURA_ORGANIZACIONAL_RESUMIDA } from "../../utils/constants";
import { Unidade } from "../../types/Unidade";
import { mapUnidade } from "../../utils/maps";
import { ORGAOS_SISP } from "../../utils/ORGAOS_SISP";
import Table from "../../components/Table";


const Estrutura = () => {
    const [unidades, setUnidades] = useState<Unidade[]>();

    useEffect(() => {
        fetch(URL_ESTRUTURA_ORGANIZACIONAL_RESUMIDA(26)).then(req => {
            req.json().then(r => {
                const unidadesTmp = mapUnidade(r?.unidades?.filter((u: Unidade) => ORGAOS_SISP.map(o => o.sigla).includes(u.sigla))); 

                setUnidades(unidadesTmp);
            })
        })
    }, [])

    return <>
        <Table data={unidades ?? []} />
    </>
}

export default Estrutura
